import * as Styled from "./styles";
import React from "react";

export const CompanyProfiles = ({
  companyProfileValues,
  count,
  getCompanyProfiles,
  symbols,
}) => {
  return (
    <Styled.Section>
      <Styled.TilesContainer>
        {companyProfileValues?.map((companyProfile, index) => (
          <div key={index} className="single-tile">
            <button onClick={console.log("hi")}>
              <span className="single-tile__name">
                name : {companyProfile.name}
              </span>
            </button>
            <span>country : {companyProfile.country}</span>
            <span>currency : {companyProfile.currency}</span>
            <span>web url : {companyProfile.weburl}</span>
          </div>
        ))}
      </Styled.TilesContainer>
      {companyProfileValues.length < count && (
        <button
          onClick={() =>
            getCompanyProfiles(
              symbols,
              companyProfileValues.length + 1,
              companyProfileValues.length + 5
            )
          }
        >
          Get more
        </button>
      )}
    </Styled.Section>
  );
};
